import React from 'react';
import { Link } from 'react-router-dom';
const Guideme = () => {
    return(
        <>
            <div id="screen1" className="screen1 guideBox">
                 <div className="msgBox"> 
                    <h1>Check Out Leadership Board Folks</h1>
                    <Link  onClick={guideMe} to="/"  className="btn btn-info">Got It!</Link>
               </div>
            </div>
        </>
    );
}
const guideMe = () => { 
    var element = document.getElementById("screen1");
    element.classList.add("ShowGuide");    
    var elements = document.getElementById("Leadership");
    elements.classList.add('Zindex');     
}
export default Guideme;
